import React, {Component} from 'react';
import Section from './Section'
import AOS from 'aos';
import './App.css';
import './aos.css';
import 'aos/dist/aos.css';

import dafyddLink from './images/Dafydd.jpg';


class App extends Component {
  componentDidMount() {
    AOS.init({
      duration : 2000
    })
  }

  render() {
    return (
      <div>
        <Title/>
        <Section image="images/Dafydd.jpg">
          Fuecku ur in the pussa
        </Section>
      </div>
    );
  }
}


class Title extends Component {
  render() {
    return (
      <div className="Title">
        <div className="TitleAnchor"/>
        <h1 className="TitleText" data-aos="f-off" data-aos-anchor=".TitleAnchor" data-aos-anchor-placement="bottom-top" data-aos-duration="300">
          MAGDALEN BALL
        </h1>
      </div>
    );
  }
}

class Tickets extends Component {
  render() {
    return (
      <div className="TicketsContainer">
      </div>
    );
  }
}

export default App;
